import {useContext} from "react";
import AuthContext from "./AuthProvider";

const Logout = () => {
    const {setAuth} = useContext(AuthContext)

    const logout = async () => {
        try {
            localStorage.removeItem("token")
            const accessToken = "";
            const role = "";
            const id = "";
            await setAuth({accessToken, role, id});
        } catch (err) {
            console.log(err)
        }
        return logout;
    }
}
export default Logout
